import { ADDRESS } from "../ethereum/web3";

const Sidebar = (props) => {
  return (
    <div className="sidebar">
      <div className="holder">
        <p>
          ID: {props.userIds}
          <br />
          <br />
          {props.partnersCount}
          <br />
          <br />
        </p>
        <div className="content-goals"></div>
        <div classname="oneMillion"></div>
      </div>
      <div className="divider"></div>
      <div className="holder">
        <div className="content-goals"></div>
        <div className="content-goals"></div>
      </div>
      <div className="divider"></div>
      <div className="holder">
        <div className="content-user">
          Your referal Link: www.sonstwas.io/{props.userIds}
        </div>
        <div className="content-user">
          <h4>Your Ethereum Wallet Address</h4>
          {props.account}
        </div>
        <div className="content-user">
          smart contract address:
          {props.ADDRESS}
        </div>
      </div>
      <style jsx>{`
        .sidebar {
          height: 100%;
          background: rgba(28, 22, 85, 1);
          border-radius: 20px;
          padding: 10px;
        }
        .holder {
          text-align: center;
          width: 90%;
          margin: 0 auto;
        }
        .divider {
          width: 90%;
          margin: 10px auto;
          background: grey;
          height: 1px;
        }
      `}</style>
    </div>
  );
};

export default Sidebar;
